import React from 'react';
import Text from "../../helpers/Text";

function ImageAndName(props) {
    return (
        <div className="row">
            <div>
                <img/>
            </div>
            <div>
                <Text text="Name"/>
                <Text text="profession"/>
            </div>
        </div>
    );
}

export default ImageAndName;
